import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-br from-blue-50 to-blue-100 px-4">
      <h1 className="text-5xl md:text-6xl font-extrabold text-gray-800 mb-6 text-center drop-shadow-lg">
        Welcome to DocuManage
      </h1>
      <p className="text-gray-600 text-lg md:text-xl text-center max-w-xl mb-8">
        Securely upload, organize, and manage your documents with ease and confidence.
      </p>
      <div className="flex space-x-4">
        <Link to="/login" className="bg-blue-600 text-white px-6 py-3 rounded-xl font-semibold hover:bg-blue-700 transition">
          Get Started
        </Link>
        <Link to="/register" className="bg-white border border-blue-600 text-blue-600 px-6 py-3 rounded-xl font-semibold hover:bg-blue-50 transition">
          Register
        </Link>
      </div>
    </div>
  );
}
